Sure! Here's a sample code in C with Win32 API to delete all files in a specified directory in Windows:

```c
#include <stdio.h>
#include <windows.h>

void DeleteFilesInFolder(const char* folderPath) {
    char files[MAX_PATH];
    strcpy(files, folderPath);
    strcat(files, "\\*");

    WIN32_FIND_DATAA findData;
    HANDLE hFind = FindFirstFileA(files, &findData);

    if (hFind != INVALID_HANDLE_VALUE) {

        do
        {
            if (!(findData.dwFileAttributes & FILE_ATTRIBUTE_DIRECTORY))
            {
                char fileName[MAX_PATH];
                strcpy(fileName, folderPath);
                strcat(fileName, "\\");
                strcat(fileName, findData.cFileName);

                if (DeleteFileA(fileName))
                    printf("Deleted file: %s\n", findData.cFileName);
                else
                    printf("Failed to delete file: %s\n", findData.cFileName);
            }
        } while (FindNextFileA(hFind, &findData));

        FindClose(hFind);
    }
    else
    {
        printf("Failed to find files or directory does not exist!\n");
    }
}

int main() {
    const char* folderPath = "your-folder-path";        // Update the folder path

    DeleteFilesInFolder(folderPath);

    return 0;
}
```

Replace `your-folder-path` in the `const char* folderPath` with the path to the directory you want to delete files from.

Remember, this code only deletes regular files and not subdirectories. Use with caution and double-check the directory before running the code.

